"use strict";

    (function () {
        var e = document.getElementById("trafficChart");
        "undefined" != typeof Chart &&
            e &&
            new Chart(e, {
                type: "doughnut",
                options: {
                    tooltips: {
                        callbacks: {
                            afterLabel: function () {
                                return "%";
                            },
                        },
                    },
                },
                data: {
                    labels: ["Total", "Sold", "Not Sold"],
                    datasets: [
                        { data: [100, 25, 15], backgroundColor: ["#2C7BE5", "#A6C5F7", "#D2DDEC"] },
                        { data: [100, 45, 20], backgroundColor: ["#2C7BE5", "#A6C5F7", "#D2DDEC"], hidden: !0 },
                    ],
                },
            });
    })()

